export default {
		Login: async (username, password) => {
				return await storeValue("userdata", { "username" : username, "password": password }).then(() => {
						return getLoginToken.run().then(res => res)
				}).then((res) => {
						if(res.hasOwnProperty('access')) {
								return res
						}

						return {}
				}).catch(() => showAlert("Login ou senha incorretos"))
		}
}
